import React, { Component } from 'react';
import './App.css';
import EFE from './Elements/EFirstElem';
import CCDog from './ClassComponents/CCDog';

export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = { appAge: 7 };
  }


getData(data) {
  //alert('from app  = ' + data);
  appAge = data;
  alert('from appAge  = ' + appAge);
}

render(){
  return (
    <div style={{ padding: 5 }}>
      APP {appAge}

      <CCDog name="Snoopy" hasBone={true} sendData={getData} />
      <CCDog name="chubi" hasBone={false} sendData={getData} />
      {EFE}
    </div>);
}
}
